import "./App.css";
import Sidebar from "./components/Sidebar.js";

function App() {
  return (
    <div className="App">
      <div class="container">
        <div class="row py-3">
          <div class="col-3 order-2" id="sticky-sidebar">
            <div class="sticky-top">
              <Sidebar />
            </div>
          </div>
          <div class="col" id="main">
            <h1>Main Area</h1>
          </div>
        </div>
      </div>

      <p>Some other content</p>
    </div>
  );
}

export default App;
